{"css.json":"{
	// Place your snippets for css here. Each snippet is defined under a snippet name and has a prefix, body and 
	// description. The prefix is what is used to trigger the snippet and the body will be expanded and inserted. Possible variables are:
	// $1, $2 for tab stops, $0 for the final cursor position, and ${1:label}, ${2:another} for placeholders. Placeholders with the 
	// same ids are connected.
	// Example:
	// "Print to console": {
	// 	"prefix": "log",
	// 	"body": [
	// 		"console.log('$1');",
	// 		"$2"
	// 	],
	// 	"description": "Log output to console"
	// }
	"Base css-Background-Margin-Paddding": {
		"prefix": "-bmp",
		"body": [
			"background: ${1:grey};",
			"border: ${2:1px} solid black;",
			"margin: ${3:0};",
			"padding: ${4:0};",
			"box-sizing: border-box;"
		],
		"description": "background, border, margin y padding"
	},
	"width and height Pixel": {
		"prefix": "-whpx",
		"body": [
			"width: ${1:200}px;",
			"height: ${0:300}px};",
		],
		"description": "ancho y alto con pixel "
	},
	"width and height %": {
		"prefix": "-wh",
		"body": [
			"width: ${1:200%};",
			"height: ${0:300%};",
		],
		"description": "ancho y alto con % o vw/vh"
	},
	"Format Font-Family": {
		"prefix": "-ffont",
		"body": [
			"font-family: 'Gill Sans', 'Gill Sans MT', Calibri, 'Trebuchet MS', sans-serif;",
			"font-size: ${1:large};",
			"font-style: normal;",
			"font-weight: ${2:bold};",
			"text-transform: ${3:capitalize};",
			"text-align: ${4:center};",
		],
		"description": "font-family, size, style, ewight, transform, align"
	},
	"Border-Solid-1px": {
		"prefix": "-border",
		"body": [
			"border${1:-top}: ${2:1}px ${3:solid} ${0:black};",
		],
		"description": "BorderTOP"
	},
	"url-photo-random": {
		"prefix": "-lorempixel",
		"body": [
			"url=(\"https://picsum.photos/${1:200}/${2:200}\")"
		],
		"description": "Generate url=(Photo) Photo WIDTH / HEIGHT"
	},
	"Reset styles": {
		"prefix": "-reset",
		"body": [
			"* {",
			"\tmargin: 0;",
			"\tpadding: 0;",
			"\tbox-sizing: border-box;",
			"\ttext-transform: capitalize;",
			"}",
			"ul li {",
			"\tlist-style: none;",
			"}",
			"a  {",
			"\ttext-decoration: none;",
			"\tdisplay: inline-block;",
			"\tmargin: 5px;",
			"}",
		],
		"description": "Reset margin and padding 0 and box-sizing"
	},
	"Madia Queris small divices 676px": {
		"prefix": "-@mediaS",
		"body": [
			"@media (max-width:676px) {${0}}"
		],
		"description": "For mobiles 470px or less"
	},
	"Madia Queris medium divices 800px": {
		"prefix": "-@mediaM",
		"body": [
			"@media (max-width:800px) {${0}}"
		],
		"description": "Media queris medium divices 800px or less"
	},
	"Madia Queris custom NUMpx": {
		"prefix": "-@mediaC",
		"body": [
			"@media (max-width:${1:800}px) {${0}}"
		],
		"description": "Max-width: 800px Medium screem-> 0px to 800px "
	},
	"nav row": {
		"prefix": "-navrow",
		"body": [
			"nav {",
			"\tbackground: mediumaquamarine;",
			"\topacity: 0.7;",
			"\tdisplay: flex;",
			"\tjustify-content: center;",
			"\tposition: fixed;",
			"\ttop: 0;",
			"\twidth: 100%;",
			"}",
		],
		"description": "van en fila "
	},
}","html.json":"{
